import { Box, css } from '@mui/material'
import React from 'react'
import { Background } from '../../../components/Background'

export function VouchForm(): React.ReactElement {

  const styles = {
    wrapper: css`
      position: relative;
      padding-bottom: 260px;
      max-width: 1307px;
      margin: 0 auto;
    `,
    poolWrapper: css`
      position: relative;
      margin-bottom: 40px;
      z-index: 1;
    `,
  }

  return (
    <Box css={styles.wrapper}>
      <p>Hello World!</p>
      <Box css={styles.title}>Vouch</Box>
      {creditLinePoolNames.map((creditLinePoolName) => (
        <Box css={styles.poolWrapper} key={creditLinePoolName}>
          <BorrowCreditLinePool
            poolName={creditLinePoolName}
            key={creditLinePoolName}
          />
        </Box>
      ))}
      <Background />
    </Box>
  )
}
